import { useState } from "react";
import './App.css';

//for toastyfy
import { ToastContainer, toast } from 'react-toastify';
//for toastyfy
import 'react-toastify/dist/ReactToastify.css';
import Forms from "./components/Forms";

function App() {

  return (
    <div className="App">
      <div className="container">
        <div className="generator">
          <h2 className="generator_header">
            Password Generator
          </h2>
         <div className="generate_password">
         <button className="copy_button">
            <i className="far fa-clipboard"></i>
          </button>
         </div>
         {/* Forms */}
         <Forms/>
         <button className="generator__btn">
            Generate Password
          </button>
          <ToastContainer
            position="top-center"
            autoClose={5000}
            hideProgressBar={false}
            newestOnTop={false}
            closeOnClick
            rtl={false}
            pauseOnFocusLoss
            draggable
            pauseOnHover
          />
        </div>
      </div>

    </div>
  );
}

export default App;
